-- Name: ihale_sonlandir(); Type: PROCEDURE; Schema: public; Owner: postgres
--

CREATE PROCEDURE public.ihale_sonlandir()
    LANGUAGE plpgsql
    AS $$
DECLARE
    r RECORD;       
    v_kazanan_id INT; 
BEGIN
    FOR r IN 
        SELECT urun_id, son_fiyat 
        FROM urunler 
        WHERE bitis_tarihi <= NOW() AND durum = 'aktif'
    LOOP
        SELECT kullanici_id INTO v_kazanan_id 
        FROM teklifler 
        WHERE urun_id = r.urun_id 
        ORDER BY teklif_miktari DESC 
        LIMIT 1;

        IF v_kazanan_id IS NOT NULL THEN
            UPDATE kullanicilar 
            SET bakiye = bakiye - r.son_fiyat 
            WHERE kullanici_id = v_kazanan_id;

            INSERT INTO satislar (urun_id, kullanici_id, satis_fiyati) 
            VALUES (r.urun_id, v_kazanan_id, r.son_fiyat);

            UPDATE urunler 
            SET durum = 'satildi', kazanan_id = v_kazanan_id 
            WHERE urun_id = r.urun_id;
        ELSE
            UPDATE urunler 
            SET durum = 'pasif' 
            WHERE urun_id = r.urun_id;
        END IF;
        
        COMMIT;
    END LOOP;
END;
$$;


